
import marshal, base64

def xor_decrypt(data, keys):
    for key in reversed(keys):
        data = bytes(b ^ key for b in data)
    return data

def descramble_bytes(data, indexes):
    unscrambled = bytearray(len(data))
    for i, idx in enumerate(indexes):
        unscrambled[idx] = data[i]
    return bytes(unscrambled)

